import './App.css';
import axios from 'axios';


const App = () => {
  const [toHash, setToHash] = useState("");
  // load the zokrates compiled function file (out) needed for the proof generation
  return (
    <div className="App">
      <header className="App-header">
          <div>
          <p>
          Insert secret
          </p>
          </div>
          <input value={toHash} onChange={evt => setToHash(evt.target.toHash)} />
        <button onClick={ async () => {
           const hashed = import('witness').then( wsm => {
               console.log(wsm)
                return wsm.genHash(toHash);
            });
        console.log(hashed);
        }
        }>
         </button>
      </header>
    </div>
  );
};
export default App;
